import * as React from 'react';
import { StyleSheet } from 'react-native';

import Components_Login from '../components/Components_Login';
import { Text, View } from '../components/Themed';
import { RootTabScreenProps } from '../types';

import { Button } from 'react-native';

import { Auth } from 'aws-amplify';

function TabLogin({ navigation }: RootTabScreenProps<'TabLogin'>) {
  return (
    <View style={styles.container}>
      <View>
        <Button 
        onPress={signOut}
        title="Sing Out of the chat"
        color="#ff9900"
        />
      </View>

      <View style={styles.separator} lightColor="#eee" darkColor="rgba(255,255,255,0.1)" />

      <View>
      <Text style={styles.title}>Login</Text>
      <Text>This is the chat</Text>

      <View style={styles.card_message}>
        <Text style={styles.username}>Name of user</Text>
        <Text style={styles.message_text}>Message of the user</Text>
      </View>
      </View>

      <View style={styles.separator} lightColor="#eee" darkColor="rgba(255,255,255,0.1)" />
      <Components_Login path="/screens/Components_Login.tsx" />
    </View>
  );
}



async function signOut() {
    try {
        await Auth.signOut({ global: true });
    } catch (error) {
        console.log('error signing out: ', error);
    }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
    overflow: 'scroll'
  },
  title: {
    fontSize: 20,
    fontWeight: 'bold',
  },
  separator: {
    marginVertical: 30,
    height: 1,
    width: '80%',
  },
  card_message: {
    backgroundColor: '#ff9900',
    borderRadius: 20,
  },
  message_text: {
    fontSize: 20,
    fontWeight: 'bold'
  },
  username: {
    fontSize: 50,
    fontWeight: 'bold'
  }
});

export default TabLogin;
